  const [color, setColor] = useState("red");
  const [number, setnumber] = useState("tn74h1234");
  return (
    <div>
      <h1>scooter:{name}</h1>
      <p>brand:{brand}</p>
      <p>vehicle color:{color}</p>
      <p>number:{number}</p>
    </div>
  );
}
export default Scooter;
